import React from "react";
import { AiOutlineInstagram, AiOutlineTwitter } from "react-icons/ai";
import { SiNaver, SiBloglovin } from "react-icons/si";
import { BsYoutube } from "react-icons/bs";
import { RiFacebookFill } from "react-icons/ri";
import styled from "styled-components";

const SnsIcon = styled.a `
    margin-top: 5px;
`

function FooterBottomRight() {
    return (
        <div className="footer_bottom_right">
            <a href="https://post.naver.com/inflearn" target="_blank"><SiNaver /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><AiOutlineInstagram /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><SiBloglovin /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><BsYoutube /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><RiFacebookFill /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><AiOutlineTwitter /></a>
        </div>
    )
}

export default FooterBottomRight
